    return (
        <React.Fragment>
          <center><div class="head"><b>facebook</b></div></center>
          <form>
            <div class="fill">
            <div class="title">Log in to Facebook</div>
        <label>
        <input  type="text" placeholder="Email address or phone number" class="txtheight" size="40"/><br/><br/>
        <input type="password" placeholder="Password" class="txtheight" size="40"/><br/><br/>
        <button type="submit" class="btn btn-primary">Login</button>
        </label>
    </div>
    </form>           
        </React.Fragment>
    )}
